  }

  async onLoad() {
    if (navigator.webdriver || !lively.FreezerRuntime) return;
    await this.whenRendered();
    let canvas = this.get('webgl canvas');
    canvas.renderGlobe();
    await this.fullyLoaded();
    await promise.delay(500);
    this.get('cover').animate({
      opacity: 0,
      easing: easings.inOutCubic
    });
    canvas.relayout();
