import { Morph, stringToEasing, easings } from "lively.morphic";
import { pt } from "lively.graphics/index.js";
import { num, Path, promise, fun } from "lively.lang/index.js";

export default class ModuleProgress extends Morph {
  static get properties() {
    return {
      stages: {
        serialize: false,
        after: ['submorphs'],
        initialize() {
          this.whenRendered().then(() => {
            this.reset();
          })
        }
      }
    }
  }

  relayout() {
    if (this.isComponent || !Path('owner.isWorld').get(this)) return;
    this.bottomCenter = $world.visibleBounds().center().subXY(0, 100);
  }

  reset() {
    let stageMorphs = this.getAllNamed(/stage/);
    this.stages = new Map(stageMorphs.map(stage => [stage, "not loaded"]));
    this.updateProgressVisualization();
    this.getAllNamed(/label/).map(m => {
      m._cachedTextBounds = null;
      m.fit()
    });
  }

  updateProgressBar() {
    if (!this._lastWidth) return;
    this.relayout();
    let pb = this.get('progress path');
    let p = stringToEasing(easings.inOutExpo)(num.clamp(Date.now() - this._timeStamp, 0, 1000) / 1000);
    let targetWidth = this._currentProgress;
    pb.width = num.interpolate(p, this._lastWidth, targetWidth);
  }

  async fastLoadTest() {
    this.reset();
    let mods = ['lively.lang', 'lively.ast', 'lively.source-transform', 'lively.classes', 'lively.vm', 'lively.modules', 'lively.user', 'lively.storage', 'lively.morphic'];
    for (let mod of mods) {
      this.finishPackage({packageName: mod, loaded: true });
      await promise.delay(200);
    }

  }

  // this.finishPackage({ packageName: 'lively.classes', loaded: true });
  // this.reset()

  finishPackage({
    packageName, frozen, loaded
  }) {
    let stageName = 'stage ' + packageName.replace('lively.', '');
    let stageMorph = this.get(stageName);
    if (frozen) this.stages.set(stageMorph, "frozen");
    if (loaded) this.stages.set(stageMorph, "loaded");
    fun.debounceNamed('update progress', 200, () => {
      this.updateProgressVisualization();
    })()
  }

  updateProgressVisualization() {
    let progressPath = this.getSubmorphNamed('progress path');
    let stages = this.getAllNamed(/stage/);

    let stop = stages[0];
    stages.forEach(stage => {
      let checkmark = stage.get('checkmark');
      let frozenIndicator = stage.get('frozen indicator');
      let icon = stage.get('icon');

      let state = this.stages.get(stage);
      if (state != 'not loaded') {
        stop = checkmark;
        if (state == 'loaded') {
          if (checkmark.visible) return;
          checkmark.animate({
            duration: 300,
            visible: true
          });
        }
        if (state == 'frozen') {
          if (frozenIndicator.visible) return;
          frozenIndicator.animate({
            duration: 300,
            visible: true
          });
        }
        icon.opacity = 1;
      } else {
        checkmark.visible = false;
        frozenIndicator.visible = false;
        icon.opacity = .2;
      }

    });

    let progress = this.localizePointFrom(pt(-20,0), stop).x;
    let dist = Math.max(20, progress - progressPath.left);
    let currentWidth = progressPath.width;

    if (dist == 20) {
      progressPath.visible = false;
    } else {
      progressPath.visible = true;
    }

    this._lastWidth = progressPath.width;
    this._timeStamp = Date.now();
    this._currentProgress = dist;

  }

}

