import { Morph, MorphicDB } from "lively.morphic";
import { LoadingIndicator } from "lively.components";
import { resource } from "lively.resources";

export class WorldLoadingScreen extends Morph {

  static get properties() {
    return {
      title: {
        derived: true,
        get() {
          return `lively.next (${document.location.hostname})`;
        }
      },
    }
  }

  get commands() {
    return [
       {
         name: 'resize on client',
         exec: () => {
           $world._cachedWindowBounds = null;
           this.setBounds($world.windowBounds());
           this.get('json target indicator').topRight = this.innerBounds().insetBy(25).topRight();
         }
       }
    ]
  }

  get __head_html__() {
    return `<style type="text/css">@import url("https://fonts.googleapis.com/css?family=Nunito:200,200i,300,300i,400,400i,600,600i,700,700i,800,800i,900,900i&display=swap");</style>`;
  }

  async onLoad() {
    if (lively.FreezerRuntime) {
      const progressBar = this.get('package loading indicator');
      progressBar.startStepping('updateProgressBar');
      document.body.style.backgroundColor = 'black';
      const worldName = this.getWorldName();
      const filePath = this.getFilePath();
      if (filePath) {
        this.get('json target indicator').animate({
          opacity: 1, duration: 300
        });
      }
      await this.transitionToLivelyWorld({ worldName, filePath }, progressBar);
      progressBar.stopStepping();
    }
  }

  async transitionToLivelyWorld({ worldName, filePath }, progressBar) {
    let progress = this.get('package loading indicator');
    let { bootstrap } = await System.import('local://lively-object-modules/PartialFreezing/bootstrap.js');

    if (worldName && worldName != "__newWorld__" && !(await MorphicDB.default.exists('world', worldName)).exists)
      return this.indicateMissingWorld(true);

    if (filePath && !await resource(document.location.origin).join(filePath).exists())
      return this.indicateMissingWorld(true);

    const loadingIndicator = LoadingIndicator.open('...starting bootstrap process...', {
      animated: true, delay: 1000,
    });
    progressBar.opacity = 1;

    await bootstrap({worldName, filePath, loadingIndicator, progress});
  }

  getWorldName() {
    if (document.location.href.endsWith('worlds/new')) return '__newWorld__';
    var loc = document.location,
        query = resource(loc.href).query(),
        worldNameMatch = query.name,
        worldName = worldNameMatch || false;
     return worldName;
  }

  getFilePath() {
    var loc = document.location,
        query = resource(loc.href).query();
     return query.file || false;
  }

  // this.indicateMissingWorld(false)

  indicateMissingWorld(active) {
    this.get('package loading indicator').visible = !active;
    this.get('broken heart').visible = this.get('broken heart').isLayoutable = active;
  }
}
